import { Card } from "antd";
import React from "react";
import {RetweetOutlinded} from "@ant-design/icons"
const PostCard = ({ post }) => {
  return (
    <div>
      <Card
        cover={post.Images[0] && <PostImages Images={post.Images} />}
        actions={[
            <RetweetOutlinded/>
        ]}
      >
        <Image />
        <Content />
      </Card>
      <CommentForm />
      <Comments />
    </div>
  );
};

export default PostCard;
